import React, {useEffect} from 'react';
import Api from './api/Api';

export default function App() {
      useEffect (() => {
        fetch('http://localhost:3001/todos')
        .then((res) => {
          return res.json();
        })
        .then((json) => {
          console.log(json);
        })
      }
    );
  return (
    <div>
      <h3>React Todos</h3>
    </div>
    );
}
